import React, { Component } from 'react';
//import logo from './logo.svg';
import { render } from 'react-dom';
import Typed from 'react-typed';

import './App.css';

import './css/stylesheet.css';
import './css/mmenu.css';
import './css/style.css';
import AdBannerImg from './img/2.jpg';
import './components/FontawesomeIcons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import 'font-awesome/css/font-awesome.min.css';
import Header from './components/Header';
import Promoted from './components/Promoted';

class App extends Component{
	render() {
		return (
			<div className="App">
				<div id="main_wrapper">
					<Header />
					<div className="clearfix"></div>
					<div className="search_container_block home_main_search_part main_search_block" style={{height: '120px'}}>
						<div className="main_inner_search_block">
							<div className="container">
								<div className="row">
									<div className="col-md-12">
										<h2>Find Your Best <span style={{color:'#f71e94'}}><Typed
											strings={[
												'Coins',
												'coin1',
												'coin2']}
												typeSpeed={80}
												backSpeed={80}
												backDelay={4000}
												startDelay={1000}
												showCursor
												loop >
										</Typed></span></h2>
										<h4> Special discount today, all our advertising services at only $100/day! Bring in investorsAdvertsiement Banner</h4> 
									</div>
								</div>
							</div>
						</div>    
					</div>
					<Promoted />
					<Todayhot />
					<a href="listings_grid_full_width.html" className="flip-banner parallax" data-background={AdBannerImg} data-color={'#000'} data-color-opacity={'0.85'} data-img-width={'2500'} data-img-height={'1666'}>
						<div className="flip-banner-content">
							<h2 className="flip-visible">Advertisement Banner</h2>    
						</div>
					</a>
				</div>
				<div id="footer" className="footer_sticky_part"> 
					<div className="container">
						<div className="row">
							<div className="col-md-12">
								<div className="footer_copyright_part">Copyright Â© 2021 All Rights Reserved.</div>
							</div>
						</div>
					</div>
				</div>  
			</div>

		);
	}
}

export default App;
